INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (1, '서울형 아이 돌봄비 지원', '영아를 키우는 가정에서 조부모(4촌 이내 친인척 포함)가 영아를 돌보는 경우 또는 서울시에서 지정한 민간기관의 아이돌봄서비스를 이용 시 돌봄 비용을 지원(택1)\n① 조부모(4촌이내 친인척 포함) 아이돌봄비(친인척형)\n② 민간 서비스 이용권(민간형) 지원\n\n지원조건\n영아1명 월 40시간 이상 친인척 돌봄 수행 또는 민간서비스 이용시(영아2명 월 60시간, 영아3명 월 80시간)\n\n지원 범위\n가정당 영아 3명까지, 영아 1명당 최대 13개월(연령 초과 전까지)\n\n지원금액\n영아1명 월 30만원 또는 30만원 상당 서울시 지정 민간 아이돌봄 서비스 이용권(영아2명 월 45만원, 영아3명 월 60만원)', '서울 거주 만24~36개월 이하 영아가 있는 기준 중위소득 150% 이하 양육공백이 발생한 가정', '온라인 신청(몽땅정보만능키)', 'https://umppa.seoul.go.kr/hmpg/reca/care/sesu/bzin/bzmgPageDetail.do?biz_mng_no=59F45FE9BC024848AD07143C962E6869', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (2, '영아 전담 아이돌봄서비스', '출산휴가, 육아휴직 후 복귀하는 맞벌이 가정을 지원하고자 영아 돌봄 교육을 이수한 전담 돌보미가 영아 이유식 먹이기, 젖병 소독 등 영아 특화 돌봄서비스 제공 ', '양육공백 가정의 만 36개월 이하 아동', '아이돌봄서비스 (https://www.idolbom.go.kr/)에서 신청가능하며 이용가정의 상황에 맞춰 서비스제공기관(자치구 가족센터 등)에서 전담 돌보미를 연계 ', 'https://umppa.seoul.go.kr/hmpg/reca/care/tyse/dech/bzmgPageDetail.do?biz_mng_no=9E79D9C6FC76487BA06F0166D979C1EF', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (3, '병원동행 아이돌봄서비스', '부모의 맞벌이 등으로 아픈 자녀의 병원 동행을 할 수 없는 경우 아이돌보미가 병원 동행 및 가정 내 돌봄 서비스 제공', '비전염성 질병 감염, 예방접종, 정기검진 등으로 병원 내원이 필요한 양육공백 가정의 만 12세 이하 아동 ', '아이돌봄서비스 (https://www.idolbom.go.kr/)에서 신청가능하며 이용가정의 상황에 맞춰 서비스제공기관(자치구 가족센터 등)에서 전담 돌보미를 연계 ', 'https://umppa.seoul.go.kr/hmpg/reca/care/tyse/dese/bzmgPageDetail.do?biz_mng_no=845065DC1CD24F62AF1B642E08CCAF87', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (4, '등하원 전담 아이돌봄서비스', '등원 사전준비, 준비물 챙기기, 등하원 동행, 하원 후 양육자 귀가 전까지 놀이활동 등 돌봄 서비스 제공 ', '어린이집, 유치원, 학교, 학원 등하원 필요한 양육공백 가정의 만 12세 이하 아동 ', '아이돌봄서비스 (https://www.idolbom.go.kr/)에서 신청가능하며 이용가정의 상황에 맞춰 서비스제공기관(자치구 가족센터 등)에서 전담 돌보미를 연계 ', 'https://umppa.seoul.go.kr/hmpg/reca/care/tyse/desc/bzmgPageDetail.do?biz_mng_no=065A6647F3584756A84FEC50EC43F413', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (5, '둘째 출산시 첫째아이 돌봄지원', '둘째 자녀 이상 출산으로 기존 자녀 돌봄에 공백이 발생한 가정에서 아이돌봄서비스 이용시 본인부담금의 90~100% 환급 \n\n지원조건\n출산 후 90일 범위내 ※ 예산소진시 종료\n\n지원금액\n1가구 당 100만원 범위 내 지원', '둘째 이상 출산으로 12세 이하 기존 자녀 돌봄에 공백이 발생한 가정 중 아이돌봄서비스 이용자(’24.1.1. 이후 출산가정)\n※ 서울시 거주 가정(주민등록상)으로 부모(둘 중 1명 이상)와 아동 함께 거주', 'ㅇ 신청방법 : 서비스제공기관(가족센터 등) 이메일 신청접수 ※ 현장 신청접수 가능', 'https://umppa.seoul.go.kr/hmpg/reca/care/bich/bzmgPageDetail.do?biz_mng_no=062A1CE5D5848B7EE063A602216299A4', 'CHILDCARE_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (6, '시간제 아이돌봄 서비스', '양육공백 가정에 아이돌보미가 찾아가 놀이활동, 준비된 식사 및 간식, 보육시설(초등학교) 등·하원(교) 동행 등 돌봄 서비스 제공 ', '12세 이하 아동', '정부지원 신청(복지로 홈페이지, 동주민센터) ', 'https://umppa.seoul.go.kr/hmpg/reca/care/gosu/pati/bzmgPageDetail.do?biz_mng_no=BC68BBB6C10A4556B10DD83259678E3A', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (7, '서울형모아어린이집', '공동 프로그램 운영 및 입소조정 등', '6개월~7세 이하 취학 전 영유아 ', '어린이집 입소 신청 및 등록\n어린이집 간 운영협의회 통해 계획 수립 및 시행', 'https://umppa.seoul.go.kr/hmpg/reca/expa/exse/sehy/bzmgPageDetail.do?biz_mng_no=8FA632D6ED55411A89A2288BC05066ED', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (8, '365일 열린어린이집', '긴급 보육 필요시 심야, 휴일에도(24시간) 보육서비스 제공 ', '서울시 거주 6개월이상 7세 이하 미취학 아동 ', '이용1일전까지 서울시보육포털서비스에서 신청 또는 해당어린이집 전화접수 ', 'https://umppa.seoul.go.kr/hmpg/reca/care/emch/opda/bzmgPageDetail.do?biz_mng_no=35AE511547C5401A8E9E8398FFC2831F', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (9, '거점형 야간보육', '야간연장보육 필요한 타원아동에 대한 보육서비스 제공 ', '가정양육아동을 포함한 모든 영유아 ', '이용당일 오후1시까지 서울시보육포털서비스에서 신청 ', 'https://umppa.seoul.go.kr/hmpg/reca/care/emch/bani/bzmgPageDetail.do?biz_mng_no=D7B026D03B2B4959A8343BE6440DB47A', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (10, '시간제 보육(정부형)', '만6개월~36개월 부모급여 또는 양육수당 수급 아동대상 시간제보육 지원 ', '6개월~36개월 미만 아동 ', '시간제 보육 아동으로 임신육아종합포털 아이사랑(보건복지부) www.childcare.go.kr 사전등록 후 사전예약 또는 당일 신청 ', 'https://umppa.seoul.go.kr/hmpg/reca/care/emch/pati/bzmgPageDetail.do?biz_mng_no=DE95E2628BFD494DB9CADC59060CCDA9', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
