INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (14, '서울형 0세 전담반 어린이집', '12개월 미만의 영아 보육에 적합한 ''0세 전담반'' 어린이집 100개반 선정 운영', '생후 12개월 미만 어린이집 보육아동', '어린이집 입소 신청 및 등록', 'https://umppa.seoul.go.kr/hmpg/reca/care/seda/bzmgPageDetail.do?biz_mng_no=8D341B53B87F4A5B922E375E45340D4C', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (15, '국공립어린이집', '국공립어린이집 확충과 품질개선 통해 공보육 인프라 강화', '6세 미만의 취학 전 아동\n* 필요한 경우 만 12세까지 보육 가능(영유아보육법 제 27조)', '어린이집 입소 신청 및 등록', 'https://umppa.seoul.go.kr/hmpg/reca/care/mkcc/bzmgPageDetail.do?biz_mng_no=1A9A7AE43415399CE063A6022162B1C2', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (16, '서울형어린이집', '공인평가를 통하여 우수한 민간 어린이집을 선정하고 인건비 및 운영비를 지원함으로써 향상된 보육서비스를 안정적으로 제공', '6개월~7세 이하 취학 전 영유아 ', '어린이집 입소 신청 및 등록\n보육포털서비스 사이트를 통해 신청 후 서비스 이용', 'https://umppa.seoul.go.kr/hmpg/reca/expa/exhi/seda/bzmgPageDetail.do?biz_mng_no=94AFA07B693E41638A92F632916A995B', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (17, '공동육아방', '부모 참여형 다양한 놀이 프로그램 운영, 육아정보 제공 및 상담 제공', '6세이하 영유아 및 보호자', '인터넷 및 전화예약 후 시설이용\n(자치구 육아종합지원센터)', 'https://umppa.seoul.go.kr/hmpg/reca/expa/exhi/shch/bzmgPageDetail.do?biz_mng_no=51BC5D78159044CC804B9EC42CB72A8E', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
