INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (20, '키움센터 긴급 · 일시돌봄', '초등 돌봄서비스 제공', '돌봄이 필요한 6~12세 아동', '보호자가 이용을 희망하는 센터에 전화, 우리동네키움포털 등으로 돌봄서비스 신청 후, 센터 승인 후 이용 가능', 'https://umppa.seoul.go.kr/hmpg/reca/care/stem/kice/bzmgPageDetail.do?biz_mng_no=1B27639C55D64ADE94F6124E0D5EBF52', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (21, '지역아동센터 긴급 · 일시돌봄', '아동보호(일상생활, 학습지도, 급식제공), 정서지원, 문화체험활동 등 돌봄 제공', '18세미만 아동(초, 중, 고등학생)', '동주민센터, 해당지역아동센터에 돌봄서비스 신청', 'https://umppa.seoul.go.kr/hmpg/reca/care/stem/loch/bzmgPageDetail.do?biz_mng_no=F60F7FA10C494469B301067083A02A61', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
INSERT INTO KIDS_POLICY (KIDS_POLICY_ID , KIDS_POLICY_TITLE , KIDS_POLICY_TEXT, KIDS_POLICY_TARGET, KIDS_POLICY_PROCESS, KIDS_POLICY_URL, KIDS_POLICY_TYPE, CREATED_AT, UPDATED_AT, DELETED, USERS_ID) VALUES (22, '키움센터 아픈아이 일시돌봄 · 병원동행', '거점형 키움센터 내 별도 돌봄공간 설치로 아픈아이에게 편안한 병상돌봄 및 전용차량을 이용한 안전한 병원동행 서비스를 제공', '질병, 예방접종 등으로 병원 내원이 필요한 12세 이하 아동\n① (비정기) 단순 감기, 복통 등 갑자기 아파 등원(교) 및 시설 이용이 곤란할 때\n② (정기) 필수 예방접종, 정기검진을 위해 병원 또는 보건소 내원이 필요할 때\n ※ 39도 이상의 고열, 감염위험이 높은 질병감염 아동은 센터 다른 서비스 이용 아동의 보호를 위하여 지원대상에서 제외', '- 거점형 키움센터 내 병상돌봄 또는 전용차량을 이용한 병원동행\n  (병상돌봄) 센터 방문 → 병상보호 → 보호자인계\n  (병원동행) 만남장소 아동픽업(전용차량) → 병원진료 → (희망시)병상보호 → 귀가 장소로 인계\n- 이용료 : 병상돌봄 2,500원 / 병원동행 무료(병원비 자부담)', 'https://umppa.seoul.go.kr/hmpg/reca/care/kiac/bzmgPageDetail.do?biz_mng_no=062627152E5ECD29E063A602216238F7', 'SERVICES_SUPPORT',  now(), now(), FALSE, 0);
