INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (38, '마포아트센터', NULL, '-아트홀 맥 아트홀 맥은 가변형 음향판과 10개의 배턴, 첨단 음향과 조명시스템을 갖추어 어떠한 장르의 공연도 소화가 가능합니다.    2008년 리모델링 공사를 통해 내부 시설보완 및 인테리어 공사를 거쳐 재 탄생한 공연장입니다. 바닥과 객석 의자를 전면 교체하여 쾌적한 공간으로 탈바꿈 하여 최적의 관람 환경을 갖추고 있습니다.   아트홀 맥은 마포아트센터에서 운영하고 있는 781석 규모의 종합공연장으로 마포구 대흥동에 위치하고 있습니다. 지하철 6호선 대흥역 2번 출구에서 5분 거리, 2호선 이대역 5번 출구에서 10분 거리에 있으며 홍대, 신촌, 서강대등 대학가에 둘러싸인 문화예술의 새로운 공간으로 부상하고 있습니다.   아트홀 맥 건물은 서울특별시 건축물대전에서 건축상 은상을 수상한 훌륭하고 멋진 건축물의 공연장으로 현대식 최첨단 시스템을 갖추고 다양한 장르의 공연을 소화할 수 있는 전문 공연장으로서 대중적이고 예술성이 뛰어난 공연은 물론 독창적인 공연 등을 기획 및 유치하여 국내외의 실력 있는 예술인, 뮤지션들이 기량을 발휘 할 수 있는 공간으로의 역할을 수행하고 있습니다.    아트홀 맥은 수려한 외관은 물론 공연장 내부도 우아함과 편안함을 함께 느낄 수 있는 쾌적한 분위기에서 공연을 감상할 수 있도록 하였습니다. 또한 관객을 위한 다양한 서비스시설(안내데스크, 넓은 휴게 공간, 여유 있는 주차장 등)을 제공하고 있습니다.    아트홀맥은 건물 내 외관의 고급스러움과 더불어 모든 시민들이 찾을 수 있는 대중적이고 편한 공연장으로 서울 서부지 역의 문화 예술 공연의 새로운 지역으로서의 역할을 다하겠습니다.    -플레이 맥 플레이 맥은 인형극, 독주회 등 소규모 공연에 적합한 공간입니다. 연극, 놀다, 연주하다 의 뜻을 지닌 ''play''라는    이름처럼 교육적이고 수준 높은 어린이 공연을 펼치고 있습니다.     -갤러리 맥 갤러리 맥은 전시의 목적에 맞게 다양한 공간 활용이 가능합니다.   체험을 기반으로 하는 엑스퍼테인먼트(Expertainment) 전시를 특화하여 작품 감상 뿐 아니라 체험이 결합된 프로그램을 즐길 수 있는 공간입니다.   -아카데미 맥 아카데미 맥은 다양한 연령대가 들을 수 있는 다양한 프로그램으로 구성되어 있습니다.    유수의 전문 강사진이 유익한 강좌를 펼치고 있습니다.    엄마와 자녀가 함께하는 프로그램부터 유아, 청소년을 위한 강좌와 직장인 강좌 등 200여개   프로그램이 운영되고 있습니다.   -스포츠센터 맥대표전화 02-3274-8500공연문의 : 02-3274-8600- 09:00-18:00 (토,일 공휴일 휴무)공연장 대관문의 : 02-3274-8618스포츠센터 문의 : 02-3274-850009:00-18:00 (매월 마지막주 일요일,공휴일 휴무)체육관 문의- 02-3274-8501,8503주차장 이용안내주차공간 : 총 152대 (장애인 주차장 포함)주차대수 : 지상 15대(셔틀버스 전용) 지하1층 : 53대 지하2층 : 84대운영시간 : 06:00 ~ 22:00주차료주차료구분내용일반차량기본 30분 : 1,000원 - 추가 10분당 : 500원공연관람 차량3시간 : 3,000원 - 추가 10분당 : 500원공연장대관차량(대관 기간중)대극장차량 5대까지 무료 - 일일주차권 12시간 기준 10,000원 판매소극장차량 3대까지 무료 - 일일주차권 12시간 기준 10,000원 판매문화체육프로그램 차량프로그램 이용 시간 초과 1시간 30분 무료강좌시간이 정해지지 않은 경우 3시간 무료추가 10분당 500원기타차량조례 제12조, 제2항에 해당하는 행사차량은 [주차확인]에 한하여 무료업무용차량(수강신청 및 방문)은 [주차확인]에 한하여 1시간 면제(추가 10분당 : 500원, 1시간 초과시[주차재확인]차량 면제)10분 이내 회 차 차량은 면제※ 적용일시 : 2017년 6월 1일 (목) 00:00 부터※ 주차요금의 1일 상한액은 15,000원입니다.※ 2개 항목 이상 주차요금 감면사유에 해당할 때에는 그 중 감면율이 높은 1개 항목만 적용됩니다주차장 이용 시 준수 사항차량관리 및 물품도난의 책임은 이용자 책임입니다.주차권 분실시 차량 소유자임을 증명하여야 하며, 주차요금은 06:00부터 주차한 것으로 계산합니다.주차장내에서 주차장 시설물 또는 다른 차량 등에 재산상 손해를 입혔을 경우,가해자는 주차관제소에 즉시 신고하고 원상복구 및 피해보상을 하여야 합니다기타 문의처주차관제소(☎02-3274-8657)？  ', NULL, '서울 마포구 대흥로20길 28 마포아트센터', '02-3274-8600', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '월요일~일요일', '06:00:00', '22:00:00', 'https://www.mfac.or.kr/', 126.945533810385, 37.5499060881738, NULL, 13, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (39, '문화역서울284', NULL, '문화역서울284는 한국 근?현대사의 주요 무대이자 교통과 교류의 관문이었던 구 서울역사의 원형을 복원하여 2011년 복합문화공간으로 개관했습니다. 문화?예술의 창작과 교류가 이루어지는 플랫폼으로서 전시, 공연, 워크숍 등 다채로운 프로그램을 진행하고 있습니다. 1900년 남대문정차장을 시작으로 경성역, 서울역을 거쳐 지금의 문화역서울284가 있기까지 시간을 따라 100여년 역사를 만나보세요.', NULL, '서울 중구 통일로 1 문화역서울284', '02-3407-3500', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '화요일~토요일', '11:00:00', '19:00:00', 'https://www.seoul284.org/main', 126.972115894161, 37.5560581817344, NULL, 24, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (40, '아르코예술기록원', NULL, '예술기록 수집, 보존, 열람서비스 전문기관 아르코예술기록원  아르코예술기록원은 한국 근현대 예술사의 흐름을 살펴볼 수 있는 중요 기록물을 수집, 보존, 서비스하고 있으며, 구술채록사업, 공연 영상화 사업 등 기록물 생산 사업도 추진하고 있습니다. 한국 근현대 예술사와 관련이 높은 도서, 음반, 영상 등을 구입하여 서비스하는 한편, 소장기록물에 기초한 전시, 교육, 연구 등 다양한 프로그램을 진행합니다.  실물 기록물의 경우 기록원을 방문하여 열람하실 수 있으며, 디지털화된 기록물은 아르코예술기록원이 구축한 한국예술디지털아카이브(DA-Arts)를 통해 열람하실 수 있습니다. ', NULL, '서울 서초구 남부순환로 2406 예술의전당 디자인미술관 2층', '02-760-4750', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '월요일~금요일', '10:00:00', '17:30:00', 'https://artsarchive.arko.or.kr/', 127.014215239186, 37.4802401962069, NULL, 15, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (41, '전쟁기념관', NULL, '옛 육군본부 자리에 들어선 전쟁기념관은 지하 2층, 지상 4층 건물로, 6천여 평 정도의 전시관을 갖추고 있다. 호국추모실?전쟁역사실?한국전쟁실?해외파병실?국군발전실?대형장비실?방산장비실 등으로 구성되어 있으며, 광장 중앙에 세워진 형제의 상은 국군장병인 형과 인민군인 아우의 모습을 기리고 있어, 갈라져 있는 남과 북의 아픔을 되새기게 한다.', NULL, '서울특별시 용산구 이태원로 29', '02-709-3114', 'INNER', 'NO_INFO', 'NO', NULL, NULL, '화요일~일요일', '09:30:00', '18:00:00', 'https://www.warmemo.or.kr/', 126.978466063237, 37.5373140468913, NULL, 21, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (42, '전태일기념관', NULL, '아름다운청년 전태일기념관은 한국노동운동사에서 중요한 기점을 마련한 저내일의 역사적 의미를 재조명하기 위해 서울시가 건림한 노동복합시설입니다.전태일은 노동자가 건강하게 일하고 공부할 수 있는 사람 중심의 세상을 만들기 위해 자신의 모든 것을 바쳤습니다.아름다운청년 전태일기념관은 전태일의 꿈을 이루기 위한 사랑?연대의 정신으로 노동자?청년?시민과 함께 행동하고자 합니다.', NULL, '서울특별시 종로구 청계천로 105', '02-318-0904', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '화요일~일요일', '10:00:00', '18:00:00', 'taeil.org', 126.989300313392, 37.5684664512813, NULL, 23, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (43, '함석헌기념관', NULL, '함석헌기념관은 우리나라를 대표하는 인권 운동가로 <씨알의 소리>를 창간하고 시인, 교육자, 사상가, 언론인, 역사가로서의 삶을 살았던 함석헌 선생(1901 ~ 1989)을 기리기 위해 마지막 여생을 보내셨던 도봉구 쌍문동 집을 보존, 리모델링하여 작은 기념관 형식으로 건립한 것입니다.함석헌 선생이 생활하셨던 지상 1층은 선생의 유품 전시, 발자취, 영상 상영 등 전시실로 구성하였으며, 창고로 사용하셨던 지하 1층은 세미나실, 도서열람실, 게스트룸 등 주민커뮤니티 공간으로 구성하였습니다. 그 외에도 씨알갤러리와 주민공간으로 유리온실과 앞마당 쉼터가 조성되어있습니다.', NULL, '서울특별시 도봉구 도봉로123길 33-6', '02-905-7007', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '화요일~일요일', '09:00:00', '18:00:00', 'http://hamsokhon.dobong.go.kr/', 127.034796402967, 37.6529616157973, NULL, 10, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (44, '은평구립도서관', NULL, '이용시간       자료실별 평 일 주 말  3월~10월 (하절기) 11월 ~ 2월 (동절기)  종합자료실 09:00 ~ 22:00 09:00 ~ 22:00 09:00 ~ 17:00  정기간행물실 09:00 ~ 18:00 09:00 ~ 18:00  어린이자료실  디지털자료실  참고 자료실  일반열람실 07:00 ~ 23:00 08:00 ~ 23:00 07:00~23:00(하절기)  08:00~23:00(동절기)   휴관일  - 정기 휴관일 : 매월 둘째, 넷째 화요일  - 일요일을 제외한 법정 공휴일, 기타 도서관 사정에 의한 임시휴관일   식당운영시간  - 월요일~금요일 : 오전 11:30~13:30 / 오후 17:00 ~ 18:30  - 토요일,일요일 : 오전 11:30~13:30 / 오후 16:30 ~ 18:00', NULL, '서울특별시 은평구 통일로78가길 13-84(불광동)', '02-385-1671-4', 'INNER', 'NO_INFO', 'NO', NULL, NULL, '화요일~일요일', '09:00:00', '18:00:00', 'http://www.eplib.or.kr/', 126.9283998, 37.6190451, NULL, 22, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (45, '아리향기작은도서관', NULL, '강서구 작은도서관은 구민이 운영하는 도서관으로 집에서 걸어서 10분내 거리에 위치하고 있습니다. 지식?정보 제공뿐 아니라 다양한 독서?문화 프로그램 운영을 통해 문화 사랑방 역할을 하는 지역 주민의 소통 공간입니다.대출권수 도서 3권대출기간 14일간(1회에 한하여 7일 연장가능)이용가능 서비스 - 도서 열람ㆍ대출ㆍ반납- 구립도서관 회원가입- 구립도서관 책두레서비스 이용- 독서ㆍ문화 프로그램 수강 등', NULL, '서울특별시 강서구 양천로67가길 63', '02-2600-7326', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '월요일~금요일', '09:30:00', '17:30:00', 'https://lib.gangseo.seoul.kr/SmallLibrary', 126.870968108368, 37.5537586591289, NULL, 4, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (46, '연세대학교 김대중도서관', NULL, '김대중도서관은 2003년 11월 아시아 최초의 대통령도서관으로 개관하였습니다. 대한민국 제15대 대통령이며 노벨평화상을 수상한 김대중 전 대통령이 도서관 건물과 1만6,000여 건의 자료, 1만여 권의 장서 그리고 노벨평화상 상금을 연세대학교에 기증한 뜻과 연세대학교의 건학 이념을 바탕으로 설립되었습니다. 김대중도서관은 민주주의와인권, 평화 구현 그리고 빈곤 퇴치를 위해 헌신한 김대중 전 대통령의 정신을 기리고 이를 위해 세계적 수준의 교육 및 연구활동, 그리고 사료 기관으로 거듭나겠습니다.김대중도서관은 주요사업으로 다음과 같은 활동을 하고 있습니다. 첫째,김대중 대통령의 일생의 자료 -대통령 재임 전, 재임기, 재임 이후, 노벨평화상 수상 관련 자료 등 김대중 대통령의 개인적 생애와 함께 우리나라 현대사의 참모습을 보고 이해할 수 있는 전시실을 운영하고 있습니다.둘째,김대중 대통령이 기증한 반세기에 걸친 국내 정치 관련 자료, 국내외에서의 민주화와 평화통일 활동 자료, 대통령 재임기 국정 수행 관련 자료, 국제 외교 자료 등을 정리하며 연구하고 있습니다.셋째,김대중 대통령의 업적을 기리는 기념사업을 하고 있습니다. 또한, 김대중 대통령 연보를 비롯해 각 분야에 걸친 김대중 연구 사업을 진행합니다. 이 사업의 일부는 정부의 “전직대통령 예우에 관한 법률”에 의한 예산 지원으로 수행됩니다.넷째,김대중 대통령을 비롯하여 민주화와 평화통일 및 야당사의 주요 증인들, 해외 인사들의 구술 인터뷰를 동영상으로 제작하여 디지털 아카이브를 만들고, 국내외 민주화와 평화통일에 관련한 자료들을 수집, 정리, 연구하는 일도 함께 하고 있습니다.다섯째,6.15남북공동선언기념, 노벨평화상 수상기념 학술회의 등 국제ㆍ국내학술회의와 오슬로 노벨평화센터 및 국내외 연구기관들과 교류협력을 통해 연구를 진행합니다.여섯째,민주주의, 평화, 빈곤퇴치에 관한 교육 사업을 진행합니다. 김대중평화아카데미 과정을 통해 평화와 통일교육, 청소년 평화 학습 등의 교육과정에 참여하고 있습니다.김대중도서관은 사업 수행을 위해 산하에 김대중평화연구소, 국제협력센터, 사료센터, 전시열람센터를 두고 있습니다.도서관 방문과 자료 검색, 각 교육과정 및 사업에 참여하는 방법은 별도로 안내가 되어있으니 참고하시기 바랍니다.그리고 김대중도서관의 운영은 연세대학교 부속기관으로서 연세대학교의 지원금과 독지가들의 정성어린 후원으로 운영되고 있습니다.이 자리를 빌어 그동안 후원에 참여하여 주신 모든 분들께 진심으로 감사드리며 앞으로 많은 분들의 참여와 후원을 부탁드립니다.', NULL, '서울특별시 마포구 신촌로4길 5-26', '02-2123-6890', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '월요일~금요일', '10:00:00', '17:00:00', 'https://www.kdjlibrary.org/', 126.929590018517, 37.5569823830529, NULL, 13, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (47, '용산문화원', NULL, '1997년 12월에 개관한 용산문화원은 용산구를 사업구역으로 하고 서울특별시장의 인가를 받아 설립된 비영리 특별법인으로 강의실과,무용실,소강당에서 약50여개의 문화강좌가 연간 진행중에 있으며, 대강당에서 각종 문화행사 및 시상식 등이 이루어지고 있는 연면적 1,286.1㎡규모의 지역문화시설 공간임.', NULL, '서울특별시 용산구 효창원로8길 28', '02-703-0052~3', 'INNER', 'NO_INFO', 'NO', NULL, NULL, NULL, NULL, NULL, 'http://yongsan.kccf.or.kr', 126.951860031908, 37.5334249577326, NULL, 21, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (48, '이스라엘문화원', NULL, '문화원은 현재 서울 강남 도심에 위치해 있으며, 이스라엘과 유대학 관련 전문서적을 구비한 전문도서관을 운영하고 있으며, 이미 이스라엘 사람이 직접 강의하는 히브리어 강좌가 개설되어 초급, 중급, 고급 과정이 진행 중이며, 국제심포지엄, 세미나, 각종 전시회, 연주회, 친선 공연, 하프 콩쿨 대회, 박람회 등을 이스라엘 대사관과 공동, 또는 단독으로 개최하여 한국 속에 이스라엘을 알리고, 한국과 이스라엘을 잇는 매개체 역할을 담당하고 있습니다. 이스라엘이 지형적으로는 작지만 전 세계에 큰 영향을 끼치듯이, 이스라엘 문화원도 이러한 이스라엘과 그 민족이 지닌 독특한 역량을 우리나라 사람들에게 친근하게 접근시켜, 두 나라가 갖고 있는 여러 유사성과 특징으로 두 민족이 서로 공유할 수 있는 만남의 장소가 될 것으로 기대해 봅니다.', NULL, '서울특별시 서초구 서초대로74길 23', '02-525-7301', 'INNER', 'NO_INFO', 'NO', NULL, NULL, '월요일~화요일, 목요일~금요일', '10:00:00', '17:00:00', 'http://www.ilculture.or.kr/main.php', 127.027090955824, 37.4956119342423, NULL, 15, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (49, '서울한방진흥센터', NULL, '다양하고 특성화된 전시와 교육, 체험을 통해 전통 한의학의 우수성과 안전성을 널리 알리고자 설립된 한방복합문화시설입니다. 서울한방진흥센터는 한방문화 및 다양한 체험 콘텐츠로 전통 한방의 우수성을  홍보하고 다양한 프로그램 개발을 통하여 한방대중화에 기여하는 것은 물론 한방상품에 대한 신뢰도를  확보하여 서울약령시를 한방산업의 거점으로 자리매김 하는데 중추적인 역할을 담당할 것입니다.', NULL, '서울특별시 동대문구 약령중앙로 26', '029699241', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '월요일~일요일', '10:00:00', '18:00:00', 'http://kmedi.ddm.go.kr', 127.037586644096, 37.5806004145096, NULL, 11, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (50, '김희수아트센터', NULL, '수림문화재단은 설립자의 <교육>과 <문화 메세나> 정신을 기리기 위하여 『김희수 기념 수림아트센터』를 건립하였다.『김희수 기념 수림아트센터』는 홍릉일대의 자연 풍경과 역사성을 함께 아우르며 <평화와 사랑에 대한 염원>, <세상의 조화와 인간의 소통>, <감사하는 마음>을 위한 공간을 지향한다.설계 단계부터 (舊)영화진흥위원회 건물의 역사성은 그대로 간직한 채 예술적, 미학적, 현대적 감각이 살아 숨 쉬는 공간으로 재창조를 시도하였다.복합문화예술공간으로써 명실상부한 서울 동북부 최고의 문화 명소가 되기를 바란다.', NULL, '서울특별시 동대문구 홍릉로 118', '0507-1365-7911', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '월요일~토요일', '12:00:00', '18:00:00', 'http://www.soorimcf.or.kr/index.html', 127.043047670789, 37.5905137067197, NULL, 11, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (51, '북촌한옥청', NULL, '''북촌 한옥청(聽)''은 가회동 11번지 언덕에 위치한 공공한옥으로, 북촌에서는 보기 드문 120평 규모의 꽤 넓은 한옥이다.''북촌 한옥청''은 시민이 스스로 만들고 함께 누리는 한옥문화콘텐츠의 장으로, 전시를 중심으로 한 연계 강연?공연?포럼 등 각종 시민 교육문화 활동이 펼쳐질 수 있도록 개방하는 공유한옥의 개념을 갖는다. 한옥과 한옥지역(북촌, 경복궁서측, 인사동, 돈화문로, 성북 등)의 다양한 주체의 활동을 지원하며, 시민의 일상 속 한옥으로서 보다 많은 한옥문화 향유 기회를 만들어 나가고자 한다.- 총 면 적 : 대지 423.10m2(128평), 건축면적 150.81m2(45평)- 시설현황 : 총 3동(안채, 문간채, 행랑채), 앞마당 등- 대관공간 : 전시실 약 42m2(12평), 세미나실 약 62m2(18평)', NULL, '서울특별시 종로구 북촌로12길 29-1', '02-2133-5582', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '화요일~일요일', '10:00:00', '18:00:00', 'https://hanok.seoul.go.kr/front/kor/life/lifeSarang.do?tab=7', 126.985645287314, 37.5827367359949, NULL, 23, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (52, '서울도시건축전시관', NULL, '2019년 3월 28일에 정식 개관한 서울도시건축전시관은 전국에서 처음으로 개관된 도시와 건축을 주제로 한 전시관으로, 기존의 박물관이나 미술관과는 다른 전시, 교육, 행사 등이 가능한 새로운 복합 시설입니다. 도시, 건축, 환경 및 정책과 관련된 기획, 상설, 대관 전시를 진행하고, 관련 정보 수집 및 아카이빙, 계절, 연휴 등의 이슈와 관련된 시민 프로그램 진행 등을 하고 있습니다. 또한, 시민에게 무상으로 제공되는 휴식공간이자 도시, 건축에 관심있는 국내외인들에게 관련 자료를 공유하고 서울시에서 진행하는 관련 전시 및 행사를 유치하는 곳입니다.전시관은 지상 1층, 지하 3층(연면적 2,998㎡) 규모로 지상층에 시민광장을 조성하고 지하 3개 층을 전시관으로 조성했으며, 지하층은 지하 보행로를 통해 시민청과 연결됩니다.', NULL, '서울특별시 중구 세종대로 119', '027368050', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '화요일~일요일', '10:00:00', '18:00:00', 'https://sca.seoul.go.kr/seoulhour/site/urbanArch/home', 126.976702419575, 37.5668837502225, NULL, 24, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (53, '박정희 가옥', NULL, '국가등록문화유산 제412호박정희 전 대통령과 그의 가족이 1958년 5월부터 1961년 8월에 국가재건최고회의 의장 관사로 이주할 때까지 살았던 집이다. 박정희 전 대통령은 이곳에서 5?16 군사 정변을 계획했다. 1979년에 박정희 전 대통령이 서거한 후에는 자녀인 박근혜 전 대통령 등 유족들이 살았다.1930년대 신당동 일대에 문화주택* 단지가 대규모로 조성되었는데, 지금은 이 집이 유일하게 남아있다. 몇 차례 증축, 수리하였지만 문화주택의 기본 틀은 유지하고 있다.  지상 1층, 지하 1층의 규모로 응접실, 서재, 부엌, 화장실 등으로 구성되어 있으며, 박정희 전 대통령이 거주하던 때의 물건들을 재현하여 자료들과 전시하고 있다. 2010년 12월부터 진행한 복원공사를 마치고 2015년에 시민들에게 개방하였다. * 문화주택(文化住宅): 1920년대부터 나타난 새로운 주택형식으로 서양식 주거문화를 지향하며 서양식 외관, 공간, 위생 설비 등을 갖춘 근대적 개량주택(출처 : 국가문화유산포털)운영시간 10:00~18:00', NULL, '서울특별시 중구 다산로36가길 25', '02-2231-5143', 'INNER', 'NO_INFO', 'YES', NULL, NULL, '화요일~일요일', '10:00:00', '18:00:00', '없음', 127.019854920988, 37.561469121354, NULL, 24, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (54, '떡박물관', NULL, '■공간소개 도시인들과 자라나는 세대 및 외국인에게 사라져 가는 부엌살림 및 떡 기물과 음식들을 통해 우리 조상들의 지혜롭고, 슬기로웠던 삶의 모습과 숨결을 느낄 수 있는 체험의 공간이자 산교육의 공간이다. 단체견학 및 체험학습    ■ 단체견학 : 월요일 ~ 토요일 10:00 ~ 16:00 (30분소요) (20인이상 단체견학 예약 시 학예사 동행 설명)    ■ 체험학습 : 월요일 ~ 토요일 10:00 ~ 15:00 - 체험내용 : 떡?부엌살림박물관 견학, 실습 및 시식 (2시간30분소요) - 참가비 : 유치원 ~고등학생(1가지 떡 실습 ) : 1만원 대학생(2가지 떡 실습) : 1만5천원    ■ 개장시간 : 월요일 ~ 토요일 10:00 ~ 17:00 일요일 ~ 공휴일 12:00 ~ 17:00    ■ 입장료 : 성인 3천원, 중?고생 2천원 (단체20인이상: 성인 2천원, 중고생 1천원)    ■ 박물관 : 2층 부엌살림박물관 , 3층 떡박물관    ■ 휴관일 : 설날 / 추석', NULL, '서울 종로구 돈화문로 71', '02-741-5447', 'INNER', 'NO_INFO', 'NO', NULL, NULL, '월요일~토요일', '10:00:00', '18:00:00', 'http://www.tkmuseum.or.kr/', 126.990638129224, 37.5748995802783, NULL, 23, FALSE, now(), now());
INSERT INTO PLACE (PLACE_ID, PLACE_NAME, PLACE_IMG_URL, PLACE_DESCRIBE, PLACE_ADDRESS, PLACE_NEW_ADDRESS, PLACE_PHONE, PLACE_TYPE, PLACE_PARKING, PLACE_FREE, PLACE_KIDS_MENU, PLACE_KIDS_TOOLS, PLACE_DAY_TYPE, START_TIME, END_TIME, PLACE_URL, X, Y, PLACE_MAIN_PLACE, REGION_ID, DELETED, CREATED_AT, UPDATED_AT) VALUES (55, '짚풀생활사박물관', NULL, '짚과 풀로 짜고 엮은 다양한 생활용구들을 모아 전시하고 있다. 짚?풀 문화는 민중인 농민들이 생활의 필요에 의해 만들어낸 문화였다. 짚으로 일일이 엮었던 계란 한 줄, 곡식을 까불러 쭉정이를 떨궈내던 키, 색색 무늬로 모서리를 장식한 반짇고리, 어머니 새색시적 치마저고리가 담긴 다락의 고리짝 등에서 우리 조상들의 생활 지혜를 엿볼 수 있다.짚풀 관련 민속자료 3,500점, 연장 200점, 조손못 2,000점, 제기(祭器) 1,000점, 한옥문 200세트, 이종석기 증유물 457 점, 세계의 팽이 100종 500여점 등을 소장하고 있다.', NULL, '서울특별시 종로구 성균관로4길 45', '02-743-8787', 'INNER', 'NO_INFO', 'NO', NULL, NULL, '화요일~토요일', '10:00:00', '17:00:00', 'http://www.jipul.com/index.php', 126.999842853497, 37.5849058490839, NULL, 23, FALSE, now(), now());
