VALUES ('1', '거울 보며 냠냠', '거울 보며 아기와 함께 숟가락 놀이를 해보세요. 숟가락 사용이 익숙하지 않은 아기가 엄마의 표정과 행동에 호기심을 가지고 따라 하며 숟가락을 사용하는 방법을 익힐 수 있고, 다양한 맛 표현을 통해 먹는 것에 흥미를 가질 수 있습니다.\n놀이 방법\n1. 거울 앞에 아기와 함께 앉습니다.\n2. 숟가락을 아기가 잡을 수 있도록 도와준 뒤 엄마도 함께 숟가락을 잡습니다.\n3. 거울을 보며 \"냠냠\" 하고 숟가락을 입에 가까이 가져갑니다.\n4. 아기가 거울 속 엄마의 모습을 따라 할 수 있도록 도와줍니다.\n5. 입을 크게 벌리 숟가락을 입에 넣고 먹는 흉내를 내며 놀이합니다. ', '이유식 숟가락, 거울, 그릇', '0세', now(), now(), FALSE, 1, 0);
VALUES ('2', '미로 안의 엄마를 찾아요', '베개로 미로를 만들어주세요. 베개 길을 따라 엉금 엉금 기어가는 과정이 대근육 발달을 도와주고, 아빠와 함께 베개 미로를 통과하며 친밀감과 애착감을 형성할 수 있습니다. \n놀이 방법\n1. 베개로 미로를 만들어주세요. \n2. 원형 안에 엄마가 들어가서 앉습니다.\n3. 아빠와 아기는 원형의 베개를 따라 기어갑니다. 엄마는 아기가 기는 행동을 응원해주세요. \n4. 베개 미로를 따라 기어가다 입구를 만나면 엄마가 아기를 안아주며 맞이합니다. \n', '베개, 방석 등 넘어가기 조금 어려운 장애물, 미로를 만들 수 있는 준비물을 활용해 주세요', '0세', now(), now(), FALSE, 1, 0);
VALUES ('3', '포스트잇을 떼어요', '가구에 포스트잇을 붙여주세요. 알록달록한 색이 아기의 시각을 자극하고 포스트잇을 떼기 위한 과정을 통해 눈과 손의 협응력과 대근육 발달을 도와줍니다. \n놀이 방법\n1. 포스트잇을 아기가 손을 뻗으면 닿을 수 있는 정도의 높이에 다양하게 붙입니다. \n2. 엄마가 포스트잇을 떼는 모습을 보여줍니다.\n3. 아기가 포스트잇을 떼기 위해 움직이는 모습을 격려해줍니다.\n4. 포스트잇을 떼어냈을 때 아기의 행동을 칭찬해줍니다.  \n', '다양한 색과 크기의 포스트잇', '0세', now(), now(), FALSE, 1, 0);
VALUES ('4', '셀로판지를 구겨요', '셀로판지를 쥐고 구기는 놀이는 아기의 시각, 청각, 촉각 등 감각의 다양한 자극을 주고 눈과 손의 협응력과 소근육 발달을 증진시켜줍니다.  \n놀이 방법\n1. 아기에게 셀로판지를 보여주며 흥미를 유발합니다.  \n2. 셀로판지를 쥐여주고 자유롭게 구기거나 잡아당기게 격려합니다. \n3. 눈앞에 셀로판지를 대주어 시야의 색이 변하는 것을 경험하게 해줍니다. \n4. 구겨진 셀로판지를 동그랗게 뭉쳐 꽉 쥐거나 던져보게 합니다.  \n\n주의 사항\n1. 놀이 재료를 입에 넣지 않도록 주의해 주세요.\n2. 이 시기 아기들은 입으로 탐색하는 ‘구강기’에 해당하며, 작은 물체를 반복적으로 집으며 소근육 발달이 이루어지는 시기입니다. \n3. 놀이 시간 동안 부모님과 아기가 함께 해주시면 좋습니다.\n', '셀로판지', '0세', now(), now(), FALSE, 1, 0);
VALUES ('5', '에어캡 벽을 두드려요', '에어 캡을 벽에 붙여 주세요. 아기가 벽에 있는 에어 캡을 두드리기 위해 일어서서 놀이하는 동안 다리의 근력을 기를 수 있고, 손의 힘으로 에어 캡을 터뜨리며 소근육 발달을 증진시켜 줍니다.  \n\n놀이 방법\n1. 에어 캡을 아기 눈높이 위치의 벽에 붙여 줍니다.   \n2. 엄마가 벽을 두드리며 아기의 관심을 유도합니다. \n3. 아기가 에어 캡을 두드리는 모습과 에어 캡의 소리를 언어로 표현해 줍니다.  \n', '에어 캡', '0세', now(), now(), FALSE, 1, 0);
